import React from "react";
import "../css/VolunteerRegister.css";
import axios from 'axios';
import {useEffect, useState } from "react";
 
const VolunteerRegister = () => 
{

//Logic

  const [_id, setId] = useState("");
  const [Full_Name, setName] = useState("");
  const [Email, setEmail] = useState("");
  const [Password, setPassword] = useState("");
  const [Address, setAddress] = useState("");
  const [City, setCity] = useState("");
  const [State, setState] = useState("");
  const [Zip, setZip] = useState("");
  const [Registration, setVolunteers] = useState([]);


 
useEffect(() => {
  (async () => await Load())();
  }, []);
 
 
  async function Load()
  {
     const result = await axios.get(
         "http://localhost:8080/register/getAll");
         setVolunteers(result.data);
         console.log(result.data);
  }
 

  
     async function save(event)
    {
        event.preventDefault();
    try
        {
         await axios.post("http://localhost:8080/register/save",
        {
          Full_Name : Full_Name,
          Email : Email,
          Password : Password,
          Address : Address,
          City : City,
          State : State,
          Zip : Zip
        });
          alert("Volunteer registation has been done successfully");
          setId("");
          setName("");
          setEmail("");
          setPassword("");
          setAddress("");
          setCity("");
          setState("");
          setZip("");
          Load();
        }
    catch(err)
        {
          alert("Volunteer Registation Failed");
        }
   }
//Design

  return (
    <div className="main-register">
      <form className="myform">
        <div class="form-group col-md-12">
          <label for="Name" className="label-control">
            Full Name
          </label>
          <input
            type="text"
            class="form-control"
            placeholder="Enter Your Name"
            required 
            id="Full_Name"
            value={Full_Name}
            onChange={(event) =>
              {
                setName(event.target.value);      
              }}
          />
        </div>

        <div class="form-group col-md-12">
          <label for="inputEmail4" className="label-control">
            Email
          </label>
          <input
            type="email"
            class="form-control"
            placeholder="Email"
            required
            id="Email"
            value={Email}
            onChange={(event) =>
              {
                setEmail(event.target.value);      
              }}
            
          />
        </div>

        <div class="form-group col-md-12">
          <label for="inputPassword4" className="label-control">
            Password
          </label>
          <input
            type="password"
            class="form-control"
            placeholder="Password"
            required
            id="Password"
            value={Password}
            onChange={(event) =>
              {
                setPassword(event.target.value);      
              }}
          />
        </div>

        <div class="form-group col-md-12">
          <label for="inputAddress" className="label-control">
            Address
          </label>
          <input
            type="text"
            class="form-control"
            placeholder="1234 Main Station.."
            required
            id="Address"
            value={Address}
            onChange={(event) =>
              {
                setAddress(event.target.value);      
              }}
          />
        </div>

        <div class="form-group col-md-12">
          <label for="inputCity" className="label-control">
            City
          </label>
          <input
            type="text"
            class="form-control"
            placeholder="City"
            required
            id="City"
            value={City}
            onChange={(event) =>
              {
                setCity(event.target.value);      
              }}
          />

        </div>
        <div class="form-group col-md-12">
          <label for="inputState" className="label-control">
            State
          </label>
          <input
            type="text"
            class="form-control"
            placeholder="State"
            required
            id="State"
            value={State}
            onChange={(event) =>
              {
                setState(event.target.value);      
              }}
          />
        </div>

        <div class="form-group col-md-12">
          <label for="inputZip" className="label-control">
            Zip
          </label>
          <input
            type="text"
            class="form-control"
            placeholder="Zip"
            required
            id="Zip"
            value={Zip}
            onChange={(event) =>
              {
                setZip(event.target.value);      
              }}
          />
        </div>
        <h1></h1>

        <div class="text-center">
          <button type="submit" class="btn btn-primary" onClick={save}>
            Register
          </button>
        </div>
      </form>
    </div>
  )
    }
export default VolunteerRegister;
